import React from "react";
class Location extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lat: null,
      err: null,
    };
  }

  componentDidMount() {
    window.navigator.geolocation.getCurrentPosition(
      (position) => {
        this.setState({
          lat: position.coords.latitude,
          lon: position.coords.longitude,
        });
      },
      (error) => {
        this.setState({
          err: error.message,
        });
      }
    );
  }
  render() {
    return (
      <div>
        <div>
          {this.state.lat != null
            ? console.log(
                "Langitude" +
                  ": " +
                  this.state.lat +
                  "Longitude" +
                  ":  " +
                  this.state.lon
              )
            : this.state.err != null
            ? this.err
            : console.log("error")}
        </div>
      </div>
    );
  }
}
export default Location;
